  \"2013-03-15T23:06:34.141000\",\n\t\"name\": \"resource-investigation-of-low-and-moderate-temperature-geothermal-areas-paso-robles-san-luis-ob\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The California Division of Mines and Geology
  (CDMG) selected the Paso Robles area for detailed geothermal resource investigation
  because the area was known to contain potential geothermal resource sites and a
  population large enough to benefit from the use of a low- or moderate-temperature
  geothermal energy source. Also, the City of Paso Robles had expressed serious interest
  in developing the area's geothermal resource. The main known thermal areas are located
  in the City of Paso Robles and to the southeast of town. Open File Report OFR83-11_
  Report, 8 Plates OFR83-11. This resource is available for purchase by the California
  Geological Survey. For more information see links provided. \",\n\t\"license_title\":
